float tx[300][34];
float xTx[34][34];
float xTxInv[34][34];
float yTx[6][34];
float a[6][34];
float teste[34][1] = {{3}, {2}, {2}, {2}, {0}, {0}, {0}, {0}, {0}, {0}, {0}, {0}, {0}, {3}, {0}, {2}, {2}, {0}, {3}, {0}, {0}, {0}, {0}, {0}, {0}, {0}, {0}, {2}, {0}, {0}, {0}, {1}, {0}, {31}};
float diagnostico[6][1];
