	inversa(xTx, 34, xTxInv);
	multiplica(y, 6, 300, tx, 300, 34, yTx, &l, &c);
	multiplica(yTx, 6, 34, xTxInv, 34, 34, a, &l, &c);
	multiplica(a, 6, 34, teste, 34, 1, diagnostico, &l, &c);
